import React from 'react';
import SignupForm from './components/signup/SignupForm'
import Main from './components/Main'
import Turbulance from './components/Turbulance'
import './App.css';

function App() {
  return (
    <div className="App">
      <img className="image-form" src="https://images.unsplash.com/photo-1464820453369-31d2c0b651af?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1000&q=80" alt="" />
      <div>
        <Main />
      </div>
      {/* <Turbulance /> */}
      <div className="ui-card">
        <SignupForm />
      </div>
    </div>
  );
}

export default App;
